import React from 'react'
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend } from 'recharts';
function Chart(props) {
    const data = [
        {
            "name": "5k",
            "pv": 2400,
        },
        {
            "name": "10k",
            "pv": 1398,
        },
        {
            "name": "15k",
            "pv": 9800,
            "amt": 2290
        },
        {
            "name": "20k",
            "pv": 3908,
            "amt": 2000
        },
        {
            "name": "25k",
            "pv": 4800,
            "amt": 2181
        },
        {
            "name": "30k",
            "pv": 3800,
            "amt": 2500
        },
        {
            "name": "35k",
            "pv": 4300,
            "amt": 2100
        },
        {
            "name": "40k",
            "pv": 4300,
            "amt": 2100
        },
        {
            "name": "45k",
            "pv": 4300,
            "amt": 2100
        },
        {
            "name": "50k",
            "pv": 4300,
            "amt": 2100
        },
        {
            "name": "55k",
            "pv": 4300,
            "amt": 2100
        },
        {
            "name": "60k",
            "pv": 4300,
            "amt": 2100
        }
    ]
  return (
    <div>
          <LineChart width={730} height={250} data={data}
              margin={{ top: 5, right: 30, left: 20, bottom: 5 }}>
              <CartesianGrid
                  vertical={false}
                  strokeWidth={0.4}
              />
              <XAxis dataKey="name" />
              <YAxis strokeWidth={0.1} />
              <Tooltip />
              <Legend />
              <Line type="monotone" dataKey="pv" stroke="#8884d8" strokeWidth={1}
              />
          </LineChart>
    </div>
  )
}

export default Chart
